import React from "react";
import TeamMember from "./TeamMember";

function Team () {
    const info=[
        {img:'https://media-exp1.licdn.com/dms/image/C4D03AQFbv9LHWfEqcw/profile-displayphoto-shrink_800_800/0/1618825740700?e=1664409600&v=beta&t=w7LP_cR3VoKO5Um_mS9rcRP4yB1J8A3Bd2zWBRrYshs',
          name:'Ahouzi Youssef',  position:'CEO at PortNet',  phone:'+212 12345678' ,  email:'Ahouzi@PortNet.com',  website:'AhouziPortNet.com',},
        {img:'https://media-exp1.licdn.com/dms/image/C4E03AQGyP5MR-acJRg/profile-displayphoto-shrink_800_800/0/1572939677677?e=1664409600&v=beta&t=B3mlakZBIjxF7E6mdsh3MRBfylRVgV20XZ-kajHf5w8',
          name:'Mehdi EL MUILHI',  position:'Chief Financial and Administrative Officer',  phone:'+212 12345678' ,  email:'Mulhi@PortNet.com',  website:'MulhiPortNet.com',},
        {img:'/images/MehdiTazi.jpg',
          name:'Mehdi Tazi',  position:'Project Manager',  phone:'+212 12345678' ,  email:'Tazi@PortNet.com',  website:'TaziPortNet.com',},
        {img:'/images/NabilOuzire.jpg', 
          name:'Nabil ouzire',  position:'Project Manager',  phone:'+212 12345678' ,  email:'ouzire@PortNet.com',  website:'ouzirePortNet.com',},
        {img:'/images/SaidAITBENALI.jpg',  
          name:'Said AIT BEN ALI',  position:'Senior Java JEE Developer',  phone:'+212 12345678' ,  email:'AitBenAli@PortNet.com',  website:'AitBenAliPortNet.com',},
        {img:'/images/RymeBensbih.jpg',
          name:'Ryme Bensbih',  position:'Communication and Change Management Manager',  phone:'+212 12345678' ,  email:'Bensbih@PortNet.com',  website:'BensbihPortNet.com',}   
    ]

    const members = info.map(member => <TeamMember 
                        img ={member.img} 
                        name ={member.name}
                        position={member.position}
                        phone={member.position}
                        email={member.email}
                        website={member.website}
            />);


    return(
        <div className="row">
            {members}
        </div>
    )
}

export default Team;
